  false,\n\t\"url\": null,\n\t\"notes\": \"This metadata is for the vegetation and
  land-use geo-spatial database for San Antonio Missions National Historical Park
  (SAAN) and surrounding areas. This project is authorized as part of the USGS/NPS
  Vegetation Mapping Program. The program is being administered by the Biological
  Resources Division (BRD) of the United States Geological Survey (USGS) in conjunction
  with the National Park Service (NPS) Inventory and Monitoring Program. The NPS Gulf
  Coast Inventory and Monitoring Network is responsible for the overall management
  and oversight of all on-going mapping efforts in this network. This mapping effort
  was performed by Cogan Technology Inc. (CTI) Galena, IL under contract to the U.S.
  Bureau of Reclamation's (USBR) Remote Sensing and GIS Group, Technical Service Center,
  Denver, Colorado. All of the classification work that facilitated this project was
  completed by NatureServe and the Botanical Research Institute of Texas.\",\n\t\"license_title\":
